import React, { Component } from 'react';

class Sorting extends Component {
    constructor(props) {
        super(props);
        this.state = { value: null};
    }
    
    render() {
        return (
            <table>
                <tr>
                    <td>{this.props.name}</td>
                    <td>BBB</td>
                </tr>
                <tr>
                    <td>CCC</td>
                    <td>DDD</td>
                </tr>
            </table>
        );
    }
}
export default Sorting;
